svg.script:
//
var colorWheelLegendColorName="";
var colorWheelLegendRGBString="";
var colorWheelLegendHexString="";


function RGBStringToHexString(RGBString){
	r = parseInt(RGBString.slice(4,-1).split(",")[0]).toString(16);
	g = parseInt(RGBString.slice(4,-1).split(",")[1]).toString(16);
	b = parseInt(RGBString.slice(4,-1).split(",")[2]).toString(16);
	if (r.length == 1)    r = "0" + r;
	if (g.length == 1)    g = "0" + g;
	if (b.length == 1)    b = "0" + b;
	return "#" + r + g + b;
}



function updateColorWheelLegend(colorName, RGBString, HexString){
	colorNameArray = colorName.split("-");
	document.getElementById('color-name').textContent = colorNameArray[0];
	document.getElementById('color-block').style.fill = HexString;
  if (colorNameArray[1]) document.getElementById('color-name').textContent +=" "+colorNameArray[1];
	document.getElementById('color-RGB').textContent = RGBString;
	document.getElementById('color-hex').textContent = HexString;






	const ColorNumber = parseInt(colorNameArray[1]);
	PreferredTextColor = "Black";
	if ( ColorNumber > 50 ) PreferredTextColor = "White";

	WCAGRating = "AAA";
	if (( ColorNumber > 40 )&&( ColorNumber < 70) ) WCAGRating = "AA";

	var WCAGstring = PreferredTextColor +" text on this color achieves a WCAG Rating of " + WCAGRating ;
  if (RGBString=="")WCAGstring = "";
	document.getElementById('color-text-AAA').textContent =  WCAGstring;
	}















function colorLegendMouseOver() {
	updateColorWheelLegend(this.className.baseVal.substring(9).toUpperCase(), window.getComputedStyle(this).getPropertyValue('fill').toUpperCase(), RGBStringToHexString(window.getComputedStyle(this).getPropertyValue('fill')).toUpperCase());
}

function colorLegendClick() {
colorWheelLegendColorName = this.className.baseVal.substring(9).toUpperCase();
colorWheelLegendRGBString= window.getComputedStyle(this).getPropertyValue('fill').toUpperCase();
colorWheelLegendHexString = RGBStringToHexString(colorWheelLegendRGBString).toUpperCase();


updateColorWheelLegend(colorWheelLegendColorName, colorWheelLegendRGBString, colorWheelLegendHexString);

}


function colorLegendMouseOut() {
    //return legend to last clicked value
	updateColorWheelLegend(colorWheelLegendColorName, colorWheelLegendRGBString, colorWheelLegendHexString);
}

var theWheel = document.getElementById('wheel');
var pathsHTMLCollection = theWheel.getElementsByTagName('path');
for (var i=0; i< pathsHTMLCollection.length; i++) {
    pathsHTMLCollection[i].onmouseover = colorLegendMouseOver;
    pathsHTMLCollection[i].onmouseout = colorLegendMouseOut;
    pathsHTMLCollection[i].onclick = colorLegendClick;
}

centerCircle = document.getElementById('center-circle');
centerCircle.onmouseover = colorLegendMouseOver;
centerCircle.onmouseout = colorLegendMouseOut;
centerCircle.onclick = colorLegendClick;

var theGrays = document.getElementById('the-grays');
var rectHTMLCollection = theGrays.getElementsByTagName('rect');
for (var i=0; i< rectHTMLCollection.length; i++)
{
    rectHTMLCollection[i].onmouseover = colorLegendMouseOver;
    rectHTMLCollection[i].onmouseout = colorLegendMouseOut;
    rectHTMLCollection[i].onclick = colorLegendClick;
}


document.getElementById('hex-lookup').onclick = function(){
	var HexColorInput = window.prompt("Enter a Hex color value to search, e.g. #D91F11");

	if (HexColorInput === null) return false; // user probably hit cancel 

	HexColorInput = HexColorInput.trim();
	HexColorInput = HexColorInput.toUpperCase();

	//HexColorInput ="961574"
	//add # if not
	if(HexColorInput.indexOf("#") == -1) HexColorInput = "#" + HexColorInput;

	//run through all the CSS colors in this SVG stylesheet
	var noColorMatch = true;
	const object = document.getElementById('color-wheel-stylesheet').sheet.cssRules;
	for (const rule in object) {
	  if ((object[rule].selectorText !== undefined ) && (object[rule].selectorText.indexOf('.clr-fill-') !== -1)){
		hexString = RGBStringToHexString(object[rule].style.fill).toUpperCase();

		if(HexColorInput.localeCompare(hexString)==0){
			updateColorWheelLegend(object[rule].selectorText.substring(10).toUpperCase(), object[rule].style.fill.toUpperCase(), hexString)
			var wheelItem = document.getElementsByClassName(object[rule].selectorText.substring(1))[0].style.strokeWidth=2;
			noColorMatch = false;
			break;
		}
	  }
	}
	if (noColorMatch) alert("Apologies, " + HexColorInput +" was not found");
}



//
